INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(4,'True','United States','Salesforce Food Bank','','','','','Food Sorting','Groups;Individuals;Youth/Children','<p>Looking for a way to give back to your community during the week? Consider volunteering with our Weekday Food Sorting team at the local food bank! As a volunteer, you will help sort and package up donated food that will be distributed to families and individuals in need.</p><p><br></p><p><strong style="font-size: 16px;">Volunteers will have the opportunity to:</strong></p><ul><li>Sort and organize donated food items</li><li>Package food into boxes for distribution</li><li>Clean and maintain a safe and sanitary work environment</li><li>Work with a team of volunteers and staff to ensure efficient and effective food distribution</li></ul><p><strong style="font-size: 16px;">Qualifications and Skills:</strong></p><ul><li>Must be able to work in a fast-paced environment</li><li>Must be able to stand for extended periods of time</li><li>Must be able to lift up to 25 lbs</li><li>Must have attention to detail and the ability to follow instructions</li><li>Must be able to work as part of a team</li></ul><p style="text-align: justify;">If you have a heart for helping others and want to make a difference in your community, then this is the perfect volunteer opportunity for you!</p>','False','','False','Burlington','<p style="text-align: justify;"><strong style="font-size: 16px;">Quisque diam risus, fermentum facilisis eros eget, auctor lacinia dui</strong>. </p><p style="text-align: justify;">Mauris nec rhoncus dui. Interdum et malesuada fames ac ante ipsum primis in faucibus. Interdum et malesuada fames ac ante ipsum primis in faucibus. Donec eleifend varius lorem ut consectetur. Etiam non porta augue. Mauris condimentum sagittis ligula bibendum laoreet. </p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><strong style="font-size: 16px;">Cras dapibus elit at lacus euismod viverra ac porttitor felis</strong>. </p><p style="text-align: justify;">Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Etiam semper dui quis tellus hendrerit mollis. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Praesent tellus nulla, rhoncus ac vulputate a, varius ac sem. Quisque suscipit eleifend viverra. Proin sed lorem eget sapien volutpat accumsan quis quis metus. Etiam leo arcu, molestie quis hendrerit vitae, ultricies non sem.</p><p><br></p>','5 Wall St','01803','MA','True','Manual Labor','America/Chicago','Weekday Food Sorting @ Food Bank','/file-asset-public/FlowToolKit_VolunteerSortClothes','','6');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(5,'False','','','','','','','Cleanup','','<p>We are seeking enthusiastic volunteers to join us in our efforts to keep our neighborhood clean and beautiful! As a Neighborhood Cleanup Volunteer, you will have the opportunity to help with a variety of tasks such as picking up trash, removing graffiti, and cleaning up brush piles. By participating in this volunteer opportunity, you will make a positive impact on the environment and help make our community a better place to live.</p><p><br></p><p><strong style="font-size: 16px;">Type of Tasks:</strong></p><ul><li>Picking up litter and debris from public areas, including sidewalks, streets, and parks</li><li>Removing graffiti from buildings and other surfaces</li><li>Clearing brush piles and debris from public areas</li><li>Sorting and properly disposing of recyclable materials</li></ul><p><strong style="font-size: 16px;">Skills Needed:</strong></p><ul><li>Ability to work independently or as part of a team</li><li>Willingness to work outdoors in various weather conditions</li><li>Physically able to bend, lift, and carry items such as trash bags and debris</li><li>Strong attention to detail and ability to identify areas in need of cleaning</li><li>Ability to follow safety guidelines and properly use cleaning equipment and tools</li></ul><p><strong style="font-size: 16px;">What to Expect:</strong></p><ul><li>Check-in begins 30 minutes before the start time</li><li>Please arrive on time, dressed appropriately for outdoor work, and ready to work</li><li>You will be provided with all necessary equipment and supplies, including gloves, trash bags, and cleaning tools</li><li>You will be assigned to a team and given specific tasks and responsibilities</li><li>The cleanup event typically lasts 2-3 hours, depending on the amount of cleaning needed</li></ul><p style="text-align: justify;">Join us in making a positive impact on our community and environment by volunteering as a Neighborhood Cleanup Volunteer!</p>','False','','False','','','','','','False','','','Neighborhood Cleanup','/file-asset-public/FlowToolKit_VolunteersCleanup','','5');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(6,'False','United States','Salesforce Senior Center','','','','','Hospitality','Individuals','<p><strong style="font-size: 22px;">Community Kitchen Crew</strong></p><p><br></p><p><span style="font-size: 14px;">Do you have a passion for cooking and serving others? If so, then join our Community Kitchen Crew and make a difference in your community! Our organization is looking for enthusiastic volunteers to help us prepare and serve meals to families in need.</span></p><p><br></p><p><span style="font-size: 14px;">As a Community Kitchen Crew Volunteer, you will have the opportunity to:</span></p><p><br></p><ul><li><span style="font-size: 14px;">Cook and prepare meals for families in need</span></li><li><span style="font-size: 14px;">Serve food to families in a friendly and welcoming manner</span></li><li><span style="font-size: 14px;">Clean up and sanitize the kitchen and dining area after each meal</span></li><li><span style="font-size: 14px;">Work with a team of other volunteers to ensure a successful meal service</span></li></ul><p><strong style="font-size: 16px;">Check-in and What to Expect</strong><span style="font-size: 14px;">:</span></p><p><br></p><ul><li><span style="font-size: 14px;">Check-in begins 30 minutes before the start time.</span></li><li><span style="font-size: 14px;">Please arrive on time, dressed appropriately, and ready to work.</span></li><li><span style="font-size: 14px;">You will be provided with all necessary equipment and supplies, including aprons and gloves.</span></li><li><span style="font-size: 14px;">You will be assigned to a team and given specific tasks and responsibilities.</span></li><li><span style="font-size: 14px;">The meal service lasts approximately 2 hours, after which you will help with clean up and sanitization.</span></li></ul><p><strong style="font-size: 16px;">Qualifications and Skills</strong><span style="font-size: 14px;">:</span></p><p><br></p><ul><li><span style="font-size: 14px;">Must be at least 12 years old.</span></li><li><span style="font-size: 14px;">Must be able to follow health and safety guidelines, including wearing gloves and aprons while handling food.</span></li><li><span style="font-size: 14px;">Must be able to work in a fast-paced, team-oriented environment.</span></li><li><span style="font-size: 14px;">Must have a positive attitude, be friendly, and have the desire to help others.</span></li></ul><p><span style="font-size: 14px;">This is a rewarding opportunity to give back to your community and make a difference in the lives of families in need. Join us and become a part of our Community Kitchen Crew today!</span></p>','True','','False','Chicago','','111 W Illinois St','60654','IL','False','','America/Chicago','Community Kitchen Crew','/file-asset-public/FlowToolKit_VolunteerHospitality','','6');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(7,'False','Canada','Salesforce Tower Pet Project','','','','','Provide Transportation','Individuals','<p>Our organization has recently found a new home for one of our rescue dogs, Ruby. We are looking for a reliable and responsible volunteer to transport Ruby to her new forever home. As a volunteer, you will be responsible for ensuring Ruby&#39;s safety and comfort during the trip, and delivering her to her new family.</p><p><br></p><p><strong style="font-size: 16px;">Tasks</strong>:</p><ul><li>Pick up Ruby from our facility and ensure that she is safely secured in the vehicle</li><li>Transport Ruby to her new home according to a pre-arranged schedule</li><li>Ensure that Ruby has access to food, water, and necessary breaks during the trip</li><li>Deliver Ruby to her new family and provide any necessary information about her care</li></ul><p><strong style="font-size: 16px;">Skills Needed:</strong></p><ul><li>Must have a valid driver&#39;s license and a reliable vehicle</li><li>Must be comfortable handling dogs and have experience transporting them</li><li>Must be reliable, responsible, and able to follow through with commitments</li><li>Must have good communication skills and be comfortable interacting with new people</li></ul><p>This is a great opportunity for animal lovers who want to help rescue animals find their forever homes. By volunteering to transport Ruby, you will be making a significant contribution to our organization&#39;s mission of saving and rehoming dogs in need.</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultr