INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(9,'False','Canada','Salesforce Tower','','','','','Organizational Support','Individuals','<p>We are seeking enthusiastic volunteers to join our Event Parking Support Team for our annual fundraiser gala. As a volunteer, you will be an integral part of ensuring the smooth flow of the event by helping to guide and park cars.</p><p><br></p><p><strong style="font-size: 16px;">Tasks:</strong> </p><p>The primary tasks of volunteers will include directing traffic, guiding guests to designated parking areas, and assisting with parking cars. Volunteers will work in teams and follow instructions from the Event Parking Coordinator.</p><p><br></p><p><strong style="font-size: 16px;">Skills needed: </strong></p><p>Volunteers should have strong communication and organizational skills, and the ability to work well in a team. You should be comfortable standing for extended periods of time and working in various weather conditions. Experience in directing traffic is helpful, but not required.</p><p><br></p><p>We appreciate your interest in volunteering with us and making a difference in our community. By joining our team, you will not only have the opportunity to support a great cause but also have a fun and rewarding experience.</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultricies ultricies semper. Sed vitae maximus nisi. Duis tincidunt tempus erat id tristique. Aliquam erat volutpat. Pellentesque imperdiet, arcu laoreet commodo ornare, mi ex consectetur est, in blandit nulla erat nec dui. </p><p style="text-align: justify;"><br></p><p style="t