INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(10,'False','United States','City of Chicago','','','','','Foster/Adopt','Groups','<p><strong style="font-size: 22px;">Adopt a City Park</strong></p><p><span style="font-size: 14px;">is a volunteer opportunity for individuals who are passionate about preserving the beauty and cleanliness of our city&#39;s parks. As a volunteer, you will have the opportunity to help maintain the park by picking up trash, maintaining trails and grounds, and performing other necessary tasks to keep the park in pristine condition.</span></p><p><br></p><p><strong style="font-size: 16px;">Potential Tasks and Roles:</strong></p><ol><li><span style="font-size: 14px;">Picking up trash: Volunteers will be responsible for walking through the park and picking up any litter or debris left behind by visitors.</span></li><li><span style="font-size: 14px;">Maintaining trails and grounds: Volunteers will be responsible for keeping the trails and grounds clear of debris, fallen branches, and other hazards that may pose a risk to visitors.</span></li><li><span style="font-size: 14px;">Gardening and landscaping: Volunteers will have the opportunity to help beautify the park by planting flowers, trees, and other plants, as well as maintaining existing gardens and landscapes.</span></li><li><span style="font-size: 14px;">Other tasks: Depending on the needs of the park, volunteers may also be responsible for performing other tasks such as painting, repairing equipment, or assisting with special events.</span></li></ol><p><strong style="font-size: 16px;">Check-in and What to Expect:</strong></p><p><span style="font-size: 14px;">Upon arrival, volunteers will be greeted by the park ranger or volunteer coordinator, who will provide a brief orientation and overview of the day&#39;s tasks. Volunteers will be given gloves, bags, and any necessary tools or equipment for the day&#39;s activities. The park ranger or volunteer coordinator will be available throughout the day to answer any questions or provide assistance as needed. Volunteers can expect to work in small groups, with plenty of opportunities to take breaks and enjoy the park&#39;s natural beauty. At the end of the day, volunteers will be thanked for their hard work and dedication to preserving our city&#39;s parks.</span></p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><span style="font-size: 14px;">Join us in making a positive impact on our community and preserving the beauty of our city&#39;s parks. Sign up today for &quot;Adopt a City Park&quot; and make a difference in your community!</span></p>','True','','False','Chicago','<p style="text-align: justify;"><strong style="font-size: 16px;">Quisque diam risus, fermentum facilisis eros eget, auctor lacinia dui</strong>. </p><p style="text-align: justify;">Mauris nec rhoncus dui. Interdum et malesuada fames ac ante ipsum primis in faucibus. Interdum et malesuada fames ac ante ipsum primis in faucibus. Donec eleifend varius lorem ut consectetur. Etiam non porta augue. Mauris condimentum sagittis ligula bibendum laoreet. </p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><strong style="font-size: 16px;">Cras dapibus elit at lacus euismod viverra ac porttitor felis</strong>. </p><p style="text-align: justify;">Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Etiam semper dui quis tellus hendrerit mollis. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Praesent tellus nulla, rhoncus ac vulputate a, varius ac sem. Quisque suscipit eleifend viverra. Proin sed lorem eget sapien volutpat accumsan quis quis metus. Etiam leo arcu, molestie quis hendrerit vitae, ultricies non sem.</p><p><br></p>','','','IL','True','Manual Labor','America/Chicago','Adopt a City Park','/file-asset-public/FlowToolKit_VolunteerTrashPickup','','5');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(11,'False','Canada','Salesforce Tower Pet Project','','','','','Organizational Support','Individuals','<p>If you are passionate about animals and have a love for helping pets find their forever homes, then join us as a Clean Kennels volunteer! Volunteers will work at our pet adoption center to help keep kennels clean and provide a comfortable living space for our furry friends.</p><p><br></p><p><strong style="font-size: 16px;">Tasks and Responsibilities:</strong></p><ul><li>Clean and sanitize kennels and surrounding areas to ensure a healthy living environment for the animals</li><li>Wash bedding, bowls, and toys to keep them clean and germ-free</li><li>Assist with daily feeding and watering of animals</li><li>Help with walking dogs and providing them with much-needed exercise</li><li>Provide socialization and companionship to animals awaiting their forever homes</li><li>Assist with other shelter duties as needed</li></ul><p><strong style="font-size: 16px;">Skills and Qualifications:</strong></p><ul><li>Must be 18 years of age or older</li><li>Passionate about animals and their welfare</li><li>Ability to work in a fast-paced environment</li><li>Ability to follow instructions and maintain cleanliness and orderliness</li><li>Ability to stand, walk, and bend for extended periods</li><li>Previous experience working with animals is preferred but not required</li></ul><p><strong style="font-size: 16px;">Expectations:</strong></p><ul><li>Volunteers are expected to be punctual, dependable, and responsible.</li><li>Volunteers are expected to dress appropriately for the task and weather conditions.</li><li>Volunteers are expected to work collaboratively with shelter staff and other volunteers.</li><li>Volunteers are expected to treat all animals with kindness and respect.</li><li>Volunteers are expected to follow all shelter policies and procedures regarding the care of animals and their safety.</li></ul><p>This is an excellent opportunity for animal lovers who want to make a difference in their community. Join our team of dedicated volunteers and help us provide the best care possible for the animals in our shelter.</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultricies ultricies semper. Sed vitae maximus nisi. Duis tincidunt tempus erat id tristique. Aliquam erat volutpat. Pellentesque imperdiet, arcu laoreet commodo ornare, mi ex consectetur est, in blandit nulla erat nec dui. </p><p style="text-align: justify;"><br></p><p style="text-align: center;"><em style="font-size: 10px;">Duis commodo eget velit sed hendrerit. In hendrerit luctus laoreet. Vestibulum ante ipsum primis in faucibus orci luctus. </em></p><p style="text-align: center;"><em style="font-size: 10px;">Et ultrices posuere cubilia curae; Aliquam bibendum ipsum ante, at tempor ante dapibus a. Proin commodo aliquam sapien eu rhoncus.</em></p><p><br></p>','415 Mission St','94105','CA','False','Manual Labor','America/Chicago','Clean Kennels at Shelter','/file-asset-public/FlowToolKit_VolunteerKennelCleaning','','2');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(12,'False','Canada','Salesforce Tower','','','','','Organizational Support','Individuals','<p>We are looking for enthusiastic volunteers to support our Fall Fundraising Gala. As an Event Silent Auction Support Volunteer, you will help us organize and execute a successful silent auction. You will work alongside other volunteers and staff members to ensure that the auction runs smoothly.</p><p><br></p><p><strong style="font-size: 16px;">Tasks:</strong></p><ul><li>Assist with setting up the silent auction area prior to the event</li><li>Help organize items for auction and ensure that they are properly displayed</li><li>Answer any questions guests may have about the items</li><li>Monitor the auction and take bids from guests</li><li>Notify winners of their items and distribute them after the auction has ended</li><li>Assist with cleaning up the auction area after the event</li></ul><p><strong style="font-size: 16px;">Skills needed:</strong></p><ul><li>Strong organizational skills and attention to detail</li><li>Excellent communication and customer service skills</li><li>Comfortable with basic math and money handling</li><li>Ability to work well in a team environment and follow instructions</li><li>Must be reliable and punctual</li></ul><p>Join us for an exciting evening and help us make a difference in our community!</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultricies ultricies semper. Sed vitae maximus nisi. Duis tincidunt tempus erat id tristique. Aliquam erat volutpat. Pellentesque imperdiet, arcu laoreet commodo ornare, mi ex