INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(13,'False','Canada','Salesforce Tower','','','','','Cleanup','Individuals','<p>Volunteers will play an essential role in ensuring the success of our Fall Fundraising Gala. As an Event Cleanup Volunteer, you will be responsible for helping with the post-event cleanup. This includes taking out the trash, taking down tables and decorations, sweeping the floor, and ensuring that the venue is left clean and tidy after the event. Your participation will be crucial in helping us wrap up the event and prepare the venue for future events.</p><p><br></p><p><strong style="font-size: 16px;">Tasks:</strong></p><ul><li>Assist with the post-event cleanup of the venue</li><li>Remove all trash and debris from the event space</li><li>Take down tables, chairs, and decorations</li><li>Sweep and clean the floors</li><li>Assist with any other cleanup tasks as needed</li></ul><p><strong style="font-size: 16px;">Skills Needed:</strong></p><ul><li>Ability to work independently and as part of a team</li><li>Physical stamina and the ability to stand, bend, and lift for extended periods</li><li>Attention to detail and the ability to follow instructions</li><li>Positive attitude and willingness to help out in any way possible</li><li>Prior experience with event cleanup is a plus, but not required</li></ul><p><strong style="font-size: 16px;">Time Commitment:</strong></p><p>The Fall Fundraising Gala will take place on Saturday, October 15th, 2023, from 6:00 pm to 10:00 pm. We ask that Event Cleanup Volunteers arrive at the venue promptly at 10:00 pm and be available to help for a minimum of 2 hours.</p><p>Benefits:</p><ul><li>Opportunity to be part of a fun and exciting fundraising event</li><li>Opportunity to meet and network with like-minded individuals</li><li>Opportunity to give back to the community and support a worthy cause</li><li>Letter of recommendation upon request</li></ul><p>We appreciate your interest in volunteering with us and look forward to working with you to make our Fall Fundraising Gala a success!</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultricies ultricies semper. Sed vitae maximus nisi. Duis tincidunt tempus erat id tristique. Aliquam erat volutpat. Pellentesque imperdiet, arcu laoreet commodo ornare, mi ex consectetur est, in blandit nulla erat nec dui. </p><p style="text-align: justify;"><br></p><p style="text-align: center;"><em style="font-size: 10px;">Duis commodo eget velit sed hendrerit. In hendrerit luctus laoreet. Vestibulum ante ipsum primis in faucibus orci luctus. </em></p><p style="text-align: center;"><em style="font-size: 10px;">Et ultrices posuere cubilia curae; Aliquam bibendum ipsum ante, at tempor ante dapibus a. Proin commodo aliquam sapien eu rhoncus.</em></p><p><br></p>','415 Mission St','94105','CA','False','Manual Labor','America/Chicago','Event Cleanup','/file-asset-public/FlowToolKit_VolunteerEventCleanup','','1');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(14,'False','Australia','Sunshine Beach','','','','','Cleanup','Groups;Individuals','<p>Join our volunteer team for a monthly beach cleanup at Sunshine Beach. As a volunteer, you&#39;ll be helping to keep our beautiful beach clean and safe for both people and wildlife. This is a great opportunity to make a positive impact on the community while enjoying the great outdoors.</p><p><br></p><p><strong style="font-size: 16px;">Tasks</strong>:</p><ul><li>Collect trash and debris along the beach</li><li>Sort and dispose of collected materials properly</li><li>Help with maintaining the beach&#39;s natural habitats</li></ul><p><strong style="font-size: 16px;">Skills</strong>:</p><ul><li>Ability to work in a team and follow instructions</li><li>Comfortable working outdoors in various weather conditions</li><li>Physical ability to lift and carry objects</li><li>Attention to detail in sorting and disposing of materials</li></ul><p><strong style="font-size: 16px; color: rgb(0, 0, 0);">Benefits</strong>:</p><ul><li>Opportunity to make a positive impact on the community</li><li>Meet new people and work with a great team of volunteers</li><li>Enjoy the outdoors and get some exercise</li><li>Gain experience in environmental conservation and stewardship</li></ul><p>Join us for our next monthly cleanup at Sunshine Beach and help us keep our beautiful beach clean and safe for all!</p>','True','','False','Sunshine Beach','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultricies ultricies semper. Sed vitae maximus nisi. Duis tincidunt tempus erat id tristique. Aliquam erat volutpat. Pellentes