INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(15,'False','United States','Salesforce Food Bank','','','','','Provide Transportation','Individuals','<p>Overview: Our organization is seeking compassionate and reliable volunteers to help us with our Senior Home Delivery program. Volunteers will be responsible for picking up meal kits from our food bank and delivering them directly to seniors in need.</p><p><br></p><p><strong style="font-size: 16px;">Tasks:</strong></p><ul><li>Pick up meal kits from our food bank</li><li>Deliver meal kits to seniors in the community</li><li>Check in with seniors to ensure their needs are being met and provide a friendly visit</li><li>Report any concerns or issues to the program coordinator</li></ul><p><strong style="font-size: 16px;">Skills:</strong></p><ul><li>Must have a valid driver&#39;s license and access to a reliable vehicle</li><li>Must be comfortable interacting with seniors and providing friendly visits</li><li>Must be reliable, responsible, and able to commit to a regular delivery schedule</li><li>Must be able to follow program guidelines and instructions</li></ul><p><strong style="font-size: 16px;">What to expect:</strong></p><ul><li>Volunteers will receive training and support from our program coordinator</li><li>Volunteers will need to provide their own transportation for deliveries</li><li>Volunteers will need to follow safety protocols when interacting with seniors, including wearing masks and practicing social distancing</li><li>Volunteers will need to be available for a regular delivery schedule, typically one day per week</li></ul><p style="text-align: justify;">This is a rewarding opportunity to make a difference in the lives of seniors in your community. Join us as a Senior Home Delivery Volunteer and help ensure that our most vulnerable community members receive the food and support they need.</p>','True','','False','Chicago','','111 W Illinois St','60654','IL','False','','America/Chicago','Senior Home Delivery','/file-asset-public/FlowToolKit_VolunteerSeniorHomeDelivery','','6');
