INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(18,'False','United States','Moscone Center','','','5.0','','Tabling','Individuals','<p><strong style="font-size: 22px;">Promote Solarize Program @ Dreamforce</strong></p><p>We are looking for enthusiastic volunteers to help promote our Solarize Program at Dreamforce, one of the largest tech conferences in the world. As a volunteer, you will have the opportunity to engage with attendees and talk to them about the benefits of our solar panel program. You will help us spread the word about our initiative and encourage people to sign up for our program.</p><p>Tasks:</p><ul><li>Engage with conference attendees and promote our Solarize Program</li><li>Educate attendees about the benefits of using solar panels</li><li>Answer any questions attendees may have about the program</li><li>Encourage attendees to sign up for our Solarize Program</li><li>Collect contact information of interested attendees for follow-up purposes</li></ul><p><strong style="font-size: 16px;">Skills needed:</strong></p><ul><li>Excellent communication skills</li><li>Outgoing personality and ability to engage with people</li><li>Knowledge or interest in renewable energy and sustainability</li><li>Positive attitude and enthusiasm for the Solarize Program</li><li>Ability to work well in a team environment</li><li>Basic computer skills for data collection and follow-up</li></ul><p><strong style="font-size: 16px;">We provide:</strong></p><ul><li>Comprehensive training on the Solarize Program and our initiative</li><li>Marketing materials and handouts to use during the event</li><li>Support and guidance from our team during the event</li><li>Opportunities to network with like-minded individuals</li></ul><p style="text-align: justify;">This is a great opportunity to be part of a meaningful initiative and promote sustainable energy practices. If you are passionate about sustainability and want to make a positive impact, we encourage you to join our team. Please email us at [contact email] if you are interested in becoming a volunteer for the Solarize Program @ Dreamforce.</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 16px;">Quisque diam risus, fermentum facilisis eros eget, auctor lacinia dui</strong>. </p><p style="text-align: justify;">Mauris nec rhoncus dui. Interdum et malesuada fames ac ante ipsum primis in faucibus. Interdum et malesuada fames ac ante ipsum primis in faucibus. Donec eleifend varius lorem ut consectetur. Etiam non porta augue. Mauris condimentum sagittis ligula bibendum laoreet. </p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><strong style="font-size: 16px;">Cras dapibus elit at lacus euismod viverra ac porttitor felis</strong>. </p><p style="text-align: justify;">Class aptent taciti sociosqu ad litora torquent per conubia nostra, per inceptos himenaeos. Etiam semper dui quis tellus hendrerit mollis. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Praesent tellus nulla, rhoncus ac vulputate a, varius ac sem. Quisque suscipit eleifend viverra. Proin sed lorem eget sapien volutpat accumsan quis quis metus. Etiam leo arcu, molestie quis hendrerit vitae, ultricies non sem.</p><p><br></p>','747 Howard St','94103','CA','False','Marketing','America/Chicago','Promote Solarize Program @ Dreamforce','/file-asset-public/FlowToolKit_VolunteersHandsIn','','1');
INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(19,'False','Canada','Salesforce Tower Ranch','','','50.0','','One-on-One Support','Individuals','<p>Volunteers will be an important part of our equine therapy program, providing support to our clients during after school sessions. Volunteers will work closely with clients and horses to ensure safety and a positive experience for everyone involved. Volunteers will assist with grooming, tacking, leading, and guiding horses during sessions.</p><p><br></p><p><strong style="font-size: 16px;">Tasks:</strong></p><ul><li>Groom and tack horses before and after sessions</li><li>Guide and walk horses with clients during sessions</li><li>Assist clients with mounting and dismounting horses</li><li>Clean and maintain equipment and barn area</li><li>Assist instructors with setup and cleanup of sessions</li></ul><p><strong style="font-size: 16px;">Skills Needed:</strong></p><ul><li>Comfortable working with horses and clients with disabilities</li><li>Basic horse handling skills and knowledge of horse behavior</li><li>Ability to follow directions and work as a team</li><li>Good communication skills and ability to interact positively with clients and staff</li><li>Ability to lift up to 50 pounds and perform physical tasks such as bending and walking</li></ul><p>Join us in making a difference in the lives of our clients and horses through equine therapy!</p>','True','','False','San Francisco','<p style="text-align: justify;"><strong style="font-size: 14px;">Lorem ipsum dolor sit amet, consectetur adipiscing elit</strong>. </p><p style="text-align: justify;">Nam vitae sodales dui, a tempus mi. Donec suscipit gravida placerat. Integer placerat erat non nibh gravida aliquet. Ut arcu mi, elementum in purus in, ullamcorper vulputate augue. Pellentesque egestas vestibulum maximus. Praesent ultricies ultricies semper. Sed vitae maximus nisi. Duis tincidunt tempus erat id tristique. Aliquam erat volutpat. Pellentesque imperdiet, arcu laoree