INSERT INTO "GW_Volunteers__Volunteer_Job__c" VALUES(23,'True','United States','Salesforce Food Bank','','','','','Food Sorting','Groups;Individuals;Youth/Children','<p>We are seeking volunteers to help sort and package donated food items at our food bank on weekends. The food bank relies on volunteers to help sort and package donations, which will be distributed to people in need. This is a great opportunity to make a direct impact in your community and help fight food insecurity.</p><p><br></p><p><strong style="font-size: 16px;">Tasks</strong>:</p><ul><li>Sort and package donated food items</li><li>Ensure quality and safety of donated food items</li><li>Organize and stock food items</li><li>Maintain cleanliness of the sorting area</li><li>Follow any instructions provided by the food bank staff</li></ul><p><strong style="font-size: 16px;">Skills needed:</strong></p><ul><li>Attention to detail and ability to follow instructions</li><li>Good organizational skills</li><li>Ability to work in a team environment</li><li>Comfortable lifting boxes and standing for an extended period of time</li><li>Good communication skills</li></ul><p><strong style="font-size: 16px;">We provide:</strong></p><ul><li>Comprehensive training on food sorting and packaging procedures</li><li>A supportive and inclusive work environment</li><li>Opportunities to learn about food insecurity and community engagement</li><li>Opportunities to meet new people and work in a team environment</li></ul><p style="text-align: justify;">This is a great opportunity to make a direct impact in your community and help fight food insecurity. If you are passionate about helping others, want to learn new skills, and make a difference, we encourage you to apply for this opportunity. Please email us at [contact email] if you are interested in becoming a volunteer for Weekend Food Sorting @ Food Bank.</p>','True','','False','Burlington','<p style="text-align: justify;"><strong style="font-size: 16px;">Quisque diam risu